import MSFTTextAction from "./text-action";
import { TextActionAppearance, TextActionButtonPosition, } from "./text-action.props";
import textActionSchema from "./text-action.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { TextActionStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const TextAction = manageJss(TextActionStyles)(MSFTTextAction);
export { TextAction, TextActionAppearance, TextActionButtonPosition, textActionSchema, };
